import React , {useEffect} from 'react'
import './Navbar.css';
import MobileNavbar from './MobileNavbar';
import Navigation from './Navigation';


function Navbar() {
  return (

      <div className='navbar'>
         <Navigation/>
         <MobileNavbar/>
       </div>
    
    );
}

export default Navbar;
